VALUES ('3770005830977', 'Tégument de psyllium blond', 'VALEBIO Psyllium BIO www.valebio.com Cultivé dans son milieu naturel en inde, le tégument (enveloppe) de psyllium blond facilite le transit et la digestion. Il régule la teneur en eau des selles, favorise la reconstruction de la flore intestinale et contribue à normaliser le niveau de cholestérol Caractéristiques: Le tégument de psylium blond est un laxatif de lest naturel. Il doit être consommé avec une grande quantite d\'eau. Il est aussi un coupe faim naturel. Conseils Pour habituer en douceur le système digestif, commencer avec une cuillère à café/ jour, puis augmenter les doses jusqu\'à 2 cuillères à soupe (30g) ou plus selon l\'effet recherché. Bien mélanger dans un verre d\'eau, compote ou yaourt. Il est important de boire beaucoup deau pendant la prise de psyllium. Précaution d\'emploi: Tenr hors de lae portée des enfants Po 0i', 'https://static.openfoodfacts.org/images/products/377/000/583/0977/front_fr.4.400.jpg', '', '', '0.1', '', '85.5', '3', '', '', '', '1');

